content:
틈틈이 좋아했다눈건 무슨 x 소리지??
저번화까지 가을이 좀 안쓰러워했는데...
ㅡㅡ:;;;;;;;;

이거 남자 여자 만약에 상황바뀐거면 
솔직히 겁나 무서운 상황임 ;;;
 집에 밤에 찾아오지를 않나...무릎은 왜 꿇..

그림체가 볼수록 아쿠아맨도 생각나서 좋네요~~~
앞으로 정말 기대됩니다~~!
저 싸늘한 남자가 얼마나 스윗해질지도...&gt;&lt;&gt;&lt;

그냥, 그냥 뭔가 그런데
가슴이라 해야하나 마음이라 해야하나;
무튼 그 한켠에 위로가 되네요

형광등 갈고 난 다음 날 만났을 때는 어깨를 짚으며 반말을 했습니다. 한 동네 사는 어른과 학생입니다. 

&quot;수고했다.&quot; 

대출 신청 받고 대출증을 발급하기 위해 사진 찍을 때는 깍듯한 존댓말을 씁니다. 

&quot;선 뒤로 서 주세요.&quot; 

순간 사서와 도서관 이용객이라는 사무적인 관계가 됩니다. 둘 사이의 책상이 없어진 장면의 거리가 사물을 
가운데 둔 현실보다 더 멀어 보입니다. 그림을 매개로 하는 웹툰이 아니라면 묘사하기 어려운 장면입니다.

손내미는데 굳이 카드 저렇게 바닥에 주는거 진짜 개짜증
그러면 나도 똑같이 바닥에 주는데ㅋㅋㅋㅋㅋㅋ
그러고 자기는 어이없어하는 표정;

남고딩 : &quot;아줌마 힘들죠 내가 달래줄게요 이리 와요&quot;
남고딩 : &quot;아줌마 힘들죠 내가 달래줄게요 이리 와요&quot;
남고딩 : &quot;아줌마 힘들죠 내가 달래줄게요 이리 와요&quot;

작품 보는 동안 문득 문득 황동규님의 즐거운편지를 떠올리곤 했습니다.
&quot; 내 그대를 생각함은 항상 그대가 앉아있는 배경에서 해가 지고 바람이 부는 일처럼 사소한 일일 것이나.. &quot;
두번째집.. 잘봤습니다. 언제나 응원하겠습니다.

아이고  저 토마토 꼴좋다 나중에 변신풀려가지고 
🐕망신을 받아야 또 안 깝치고 저렇게 귀족이라고 ㅈㄹ을 안하지 우리 메이벨을 좀 보고 배워라.. 도둑놈..? 걔는 모자 여러게 받아도 감사해 하는데 저 ㅅㅋ는 &#x27;시중 궁시렁~;;
귀족 궁시렁~;;;&#x27;
어휴;;;;;;;;;;;;
